+       <Route path="/report-pf" element={<Pf/>}/>
+       <Route path="/report-esi" element={<Esi/>}/>
+       <Route path="/report-salary" element={<Salaryreport/>}/>
+       <Route path='/report-bank' element={<Bankreport/>}
